Defendant John T Schutte in court, in custody, with attorney Peter M Wolff.   Melissa Zilavy appeared for the State of Wisconsin.  Defendant enters a guilty plea to Count #1 and #3.  Court finds defendant guilty.  Count #2 is dismissed and read in.    The defendant was sentenced to the following:

Count #1:
JAIL:  90 days, (concurrent to present sentence).

FINE: $1179.00 (to be paid as a condition of probation on count #3);

DNA SURCHARGE:  $200.00, to be paid as a conditon of probation on Count #3)  Defendant to provide DNA sample, if not yet provided,   immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.
BLOOD DRAW FEE:  $35.00 paid through Waukesha County Circuit Court to be forward to Waukesha County Sheriff Department (to be paid as a condition of probation on count #3).

D/L REVOCATION: 16 months;

IGNITION INTERLOCK: 16 months;

Attendance at a Victim Impact Panel on:  (to be attended as a conditon of probation on count #3).

Other:  AODA ASSESSMENT AND FOLLOW THROUGH.

Count #3:  
The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

3 YEARS 6 MONTH IMPRISONMENT (CREDIT - 63 days) (consecutive to any other sentence);
  -  1 YEAR 6 MONTHS OF INITIAL CONFINEMENT
  -  2 YEAR(S) OF EXTENDED SUPERVISION;

TERM OF PROBATION:  3 YEAR(S); (consecutive to current sentence)

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain full time employment and/or combination of schooling 
*DNA sample to be provided if not yet previously done.
*No association with known drug users or dealers and no contact at any place where illegal drugs are purchased, used, stored, packaged, or distributed.
*Mental Heath evaluation and treatment deemed appropriate.

COURT COSTS:  $268.00 (to be paid as a condition of probation);

DNA SURCHARGE:  $250.00 (to be paid as a condition of probation);

IF REVOKED:
Defendant is eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

Felony warnings, voting rights and firearms warnings given.
